    false,nt"url": null,nt"notes": "In October 2012, WSI (Watershed Sciences,
    Inc.) was contracted by the Puget Sound LiDARConsortium (PSLC) to collect Light
    Detection and Ranging (LiDAR) data for the EntiatRiver site in central Washington.
    The area is adjacent to several other LiDAR projectscollected in the greater Wenatchee
    area since 2008. Data were collected to aid inassessing the topographic and geophysical
    properties of the study area to supportfault line and geologic instability within
    the area. The Entiat site covers 67,067 acres,collected June 23, 26, 28, 29 and
    30, 2013.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
